    for all lines 7,11,12,21b,23 and 8.  This amendment is in response to a request
    for more information, that was reponded to on December 17, 2008 which included
    the incorrect reporting period.  It was the intention of the DSCC of LA to respond
    to the November 19, 2008 request  at that time.   This amendment also includes
    a description oftransfer of  excess from Friends of Mary Landrieu.  All disbursements
    that are reported administrative are administrative and are not in connection
    with a federal candidate or election.  Salaries paid on the administrative split
    are for employees who spend less than 25% of their work hours on federal election
    activity. All payments for payroll, payroll taxes and insurance that are reported
    as administrative are not paid on behalf of employees who spend more than 25%
    of there work time on federal election activity.   Salaries reported on line 21b
    are for employees who spend less than 25% of their work hours on federal election
    activity. All payments for payroll, payroll taxes and insurance that are reported
    on line 21b are not paid on behalf of employees who spend more than 25% of there
    work time on federal election activity.  Please note the Louisiana Democratic
    Party owns it own building and therefore does not make regular rent payments."
